import { CartesianGrid, LineChart, ResponsiveContainer, Tooltip, XAxis, YAxis, Line } from "recharts";

function RackCurrentGraph({data, type}){
    const chartData = data.map(d => ({
        time: d.datetime,
        value: d.value
    }));

    return(
        <div style={{width: "100%", height: 260}}>
            <ResponsiveContainer>
                <LineChart data={chartData}>
                    <CartesianGrid strokeDasharray="3 3"/>

                    <XAxis
                        dataKey="time"
                        tick={{fontSize: 11}}
                        interval={3}
                    />
                    <YAxis
                        label={{value: Y_LABEL[type], angle: -90, position: "insideLeft"}}
                    />

                    <Tooltip/>

                    <Line
                        type="monotone"
                        dataKey="current"
                        stroke="orange"
                        strokeWidth={2}
                        dot={false}
                    />
                </LineChart>
            </ResponsiveContainer>
        </div>
    )
}

export default RackCurrentGraph;
